import React from 'react';
import {
    VictoryBar,
    VictoryChart,
    VictoryLine,
    VictoryPie,
  } from "victory";

const UserDetails = ({user}) => {
    return(
        <VictoryChart>
            <VictoryBar
                data={[
                    { day: 'Monday', logins: 1234 },
                    { day: 'Tuesday', logins: 2048 },
                    { day: 'Wednesday', logins: 2600 },
                    { day: 'Thursday', logins: 9000 },
                    { day: 'Friday', logins: 9000 },
                    { day: 'Saturday', logins: 9000 },
                    { day: 'Sunday', logins: 9000 }
                  ]}
                  x="day"
                  y="logins"
                />
            />
        </VictoryChart>
    )
}
export default UserDetails;
